package com.yskj.service;import com.yskj.dao.IntentiontypeDao;import com.yskj.models.PageParam;import com.yskj.service.base.AbstractService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;@Servicepublic class IntentiontypeService extends AbstractService {	@Autowired    private IntentiontypeDao intentiontypeDao;	public IntentiontypeService() {		super();	}	@Override	public IntentiontypeDao getDao() {		return this.intentiontypeDao;	}	public PageParam mapPage(PageParam pageParam) throws Exception {		pageParam.setList(this.getDao().mapPage(pageParam));		return  pageParam;	}	public PageParam findIntePersonPage(PageParam queryParam)throws Exception{        queryParam.setList(this.getDao().findIntePersonPage(queryParam));        return queryParam;	}}